INSERT INTO `categories` (`id`, `category_name`, `category_description`, `created_at`, `updated_at`) VALUES
(1, '{\"en\":\"Action\",\"fr\":\"Action\",\"ln\":\"Action\"}', 'Cinema qui met en scène une succession de scènes spectaculaires (courses-poursuites, fusillades, explosions, etc.) construites autour d\'un conflit résolu de manière violente.', '2024-03-30 03:20:58', '2024-07-10 07:43:58'),
(2, '{\"en\":\"Drama\",\"fr\":\"Drame\",\"ln\":\"Mawa\"}', 'Cinema qui traite des situations dans un contexte sérieux, sur un ton plus susceptible d\'inspirer la tristesse que le rire.', '2024-03-30 03:23:37', '2024-07-10 07:44:15'),
(3, '{\"en\":\"Comedy\",\"fr\":\"Com\\u00e9die\",\"ln\":\"Com\\u00e9die\"}', 'Cinema dont une des caractéristiques majeures est l\'humour ; le but étant d\'amuser les spectateurs à travers des situations, des dialogues, des personnages ou des effets à même de faire sourire ou rire.', '2024-03-30 03:25:04', '2024-07-10 07:48:10'),
(4, '{\"en\":\"Aventure\",\"fr\":\"Aventure\",\"ln\":\"Aventure\"}', 'Cinema caractérisé par la présence d\'un héros fictif ou non, tirant son statut du mythe qu\'il inspire, l\'action particulière qui s\'y déroule, l\'emploi de décors particuliers également.', '2024-03-30 03:26:54', '2024-03-30 03:26:54'),
(5, '{\"en\":\"Romance\",\"fr\":\"Romance\",\"ln\":\"Bolingo\"}', 'Cinema portant sur une histoire d\'amour ou d\'aventure amoureuse, mettant en avant la passion, les émotions et l\'engagement affectif des personnages principaux.', '2024-03-30 03:28:57', '2024-03-30 03:28:57'),
(6, '{\"en\":\"Animation\",\"fr\":\"Animation\",\"ln\":\"Animation\"}', 'Film présenté sous forme d\'ensemble de dessins ou d\'images en 2D/3D pour raconter une histoire vraie ou fictive.', '2024-03-30 03:30:39', '2024-03-30 03:30:39'),
(7, '{\"en\":\"Sketch\",\"fr\":\"Sketch\",\"ln\":\"Sketch\"}', 'Cinéma reposant sur plusieurs histoires tournant autour d\'un même thème, quel qu\'il soit ; et parfois dans un but humoristique.', '2024-03-30 03:31:23', '2024-03-30 03:31:23'),
(8, '{\"en\":\"Thriller\",\"fr\":\"Suspense\",\"ln\":\"Suspense\"}', 'Genre artistique utilisant la tension narrative pour provoquer chez le spectateur une forte attention et le tenir en haleine jusqu\'au dénouement de l\'intrigue.', '2024-03-30 03:32:59', '2024-03-30 03:32:59'),
(9, '{\"en\":\"Biography\",\"fr\":\"Biographie\",\"ln\":\"Biographie\"}', 'Œuvre ayant pour objet l\'histoire d\'une vie particulière d\'un protagoniste ou d\'un événement dans la vie du protagoniste.', '2024-03-30 03:35:11', '2024-03-30 03:35:11'),
(10, '{\"en\":\"Historical\",\"fr\":\"Historique\",\"ln\":\"Lisolo ya kala\"}', 'Genre cinématographique qui est fondé sur le principe de la fiction historique et qui met en scène des évènements historiques.', '2024-03-30 03:36:35', '2024-03-30 03:36:35'),
(11, '{\"en\":\"Science fiction\",\"fr\":\"Science-fiction\",\"ln\":\"Science-fiction\"}', 'Histoire qui consiste à raconter des fictions reposant sur des progrès scientifiques et techniques obtenus dans un futur plus ou moins lointain.', '2024-03-30 03:37:37', '2024-03-30 03:37:37'),
(12, '{\"en\":\"Documentary\",\"fr\":\"Documentaire\",\"ln\":\"Documentaire\"}', 'Film de caractère didactique ou informatif qui vise principalement à restituer les apparences de la réalité.', '2024-03-30 03:39:11', '2024-03-30 03:39:11'),
(13, '{\"en\":\"TV show\",\"fr\":\"Emission de t\\u00e9l\\u00e9\",\"ln\":\"Emission ya TV\"}', 'Il s\'agit d\'une production audiovisuelle d\'une certaine durée diffusée sur une chaîne de télévision.', '2024-03-30 03:40:45', '2024-05-23 13:46:48'),
(14, '{\"en\":\"Preach\",\"fr\":\"Pr\\u00e9dications\",\"ln\":\"Mateya\"}', 'Discours public prononcé pour parler de Dieu aux non-croyants, ou bien enseigner, exhorter ou affermir les croyants.', '2024-03-30 03:42:30', '2024-06-01 15:04:51'),
(15, '{\"en\":\"Blues\",\"fr\":\"Blues\",\"ln\":\"Blues\"}', 'Genre musical, vocal et instrumental dérivé des chants de travail des populations afro-américaines subissant la ségrégation raciale aux États-Unis.', '2024-03-30 03:43:37', '2024-03-30 03:43:37'),
(16, '{\"en\":\"Jazz\",\"fr\":\"Jazz\",\"ln\":\"Jazz\"}', 'Genre musical qui comporte des caractéristiques telles que l\'utilisation fréquente de l\'improvisation, de la polyrythmie, de la syncope, du shuffle, du scat et des notes bleues.', '2024-03-30 03:47:27', '2024-03-30 03:47:27'),
(19, '{\"en\":\"Rumba\",\"fr\":\"Rumba\",\"ln\":\"Rumba\"}', 'Genre musical composé de différentes danses, chacune avec son rythme caractéristique : yambú, columbia et guaguancó. Ce dernier est une danse partenaire rapide avec des mouvements sensuels.', '2024-03-30 03:54:59', '2024-03-30 03:54:59'),
(20, '{\"en\":\"Zouk\",\"fr\":\"Zouk\",\"ln\":\"Zouk\"}', 'Genre musical caractérisé par un tempo rapide de 120 à 145 bpm, un rythme souligné par les percussions et une forte section de cuivres.', '2024-03-30 03:56:05', '2024-03-30 03:56:05'),
(21, '{\"en\":\"Song and Lullaby\",\"fr\":\"Chanson & Berceuse\",\"ln\":\"Nzembo pona bana\"}', 'Ensemble de chansons ou des récitations à caractère didactique ou cultuel pour les enfants et les adolescents.', '2024-03-30 05:36:54', '2024-06-01 15:05:45'),
(22, '{\"en\":\"Worship\",\"fr\":\"Culte\",\"ln\":\"Losambo\"}', 'Ensemble de pratiques d\'hommage ou de vénération rendu par une église, un ministère ou un autre groupe à Dieu et au Nom de Jésus-Christ.', '2024-03-30 05:38:19', '2024-03-30 05:38:19'),
(23, '{\"en\":\"Concert\",\"fr\":\"Concert\",\"ln\":\"Concert\"}', 'Représentation musicale d\'un ou plusieurs musiciens, en public, gratuite ou non, dans un lieu aménagé à cette occasion.', '2024-03-30 05:39:06', '2024-03-30 05:39:06'),
(24, '{\"en\":\"Traditionnel\",\"fr\":\"Traditionnel\",\"ln\":\"Bokoko\"}', 'Musique qui est associée à un folklore, à une culture, une religion ou à une zone géographique.', '2024-03-30 06:07:04', '2024-07-10 07:48:42'),
(35, '{\"en\":\"Sport\",\"fr\":\"Sport\",\"ln\":\"Sport\"}', 'tout ce qui se rapporte au sport ex football, judo, athlétisme', '2024-05-20 08:14:13', '2024-05-20 08:14:13'),
(36, '{\"en\":\"African  Serie\",\"fr\":\"S\\u00e9rie Africaine\",\"ln\":\"Maboke ya Africa\"}', 'il s\'agit de séries Africaines', '2024-05-20 08:18:17', '2024-05-20 08:18:17'),
(37, '{\"en\":\"News\",\"fr\":\"Informations\",\"ln\":\"Ba Sango\"}', 'programme à caractère informatif comme journal de télévision, reportage', '2024-05-20 16:41:22', '2024-05-31 17:21:30'),
(40, '{\"en\":\"Biblical History\",\"fr\":\"Histoire Biblique\",\"ln\":\"Masolo ewuti na Biblia\"}', 'histoire des événements et/ou personnages bibliques', '2024-05-24 16:25:40', '2024-05-24 16:25:40'),
(41, '{\"en\":\"TV Channel\",\"fr\":\"Cha\\u00eene de T\\u00e9l\\u00e9\",\"ln\":\"Ndako ya Etando Enene\"}', 'Chaîne de télé', '2024-05-31 09:46:42', '2024-05-31 09:46:42'),
(42, '{\"en\":\"Gospel\",\"fr\":\"Gospel\",\"ln\":\"Gospel\"}', 'genre musical chrétien visant l\'évangélisation par la chanson', '2024-06-11 09:39:13', '2024-06-11 09:39:13'),
(43, '{\"en\":\"Feature film\",\"fr\":\"Long m\\u00e9trage\",\"ln\":\"Film Ya molayi\"}', 'Film, dessins animés long', '2024-07-06 15:37:54', '2024-07-06 16:17:31'),
(44, '{\"en\":\"Cartoons\",\"fr\":\"Dessins anim\\u00e9s\",\"ln\":\"Bililingi Ya bana\"}', 'Genre de médias destinés généralement aux enfants  conçu par animation des dessins', '2024-07-06 15:56:08', '2024-07-06 16:18:33');
