INSERT INTO `legal_info_contents` (`id`, `subtitle`, `content`, `photo_url`, `video_url`, `created_at`, `updated_at`, `legal_info_title_id`) VALUES
(2, '{\"fr\":\"En bref\",\"en\":\"Briefly\",\"ln\":\"Na mokuse\"}', '{\"fr\":\"avec son application, sa WebTV, sa cha\\u00eene YouTube et ses r\\u00e9seaux sociaux, DikiTivi  est donc la 1\\u00e8re plateforme  de divertissement Chr\\u00e9tien totalement gratuite et destin\\u00e9e au divertissement des enfants de tous les \\u00e2ges en proposant un contenu Sain, Amusant, Instructif et Divin, sans oublier les autres membres de la famille.\",\"en\":\"with its application, its WebTV, its YouTube channel and its social networks, DikiTivi is therefore the 1st completely free Christian entertainment platform intended for the entertainment of children of all ages by offering Healthy, Fun, Informative and Divine content, without forgetting other members of the family.\",\"ln\":\"DikiTivi ezali plateforme ya yambo ya ofele oyo etali kosepelisa ba Kristu na nzela  ya ba filme, ba S\\u00e9ri, Miziki, ba Dessins Anim\\u00e9s pona Bana pe Bakolo na ko tala ete manso ezala peto, esepelisa, ekolisa pe etosa mibeko ya Nzambe.\"}', NULL, NULL, '2024-10-11 14:10:40', '2024-10-11 14:10:40', 2),
(3, '{\"fr\":\"Ann\\u00e9e 2019\",\"en\":\"In 2019\",\"ln\":\"Na 2019\"}', '{\"fr\":\"\\nR\\u00e9ception du mandat pour le projet  DikitTvi,  cha\\u00eene de t\\u00e9l\\u00e9 une chr\\u00e9tienne visant \\u00e0 offrir aux parents une plateforme leur permettant de trouver pour leurs enfants des m\\u00e9dias sains, ludiques et Divins.\\n\",\"en\":\"\\nReceipt of the mandate for the DikitTvi project, a Christian TV channel aimed at offering parents a platform allowing them to find healthy, fun and Divine media for their children.\\n\\n\",\"ln\":null}', NULL, NULL, '2024-10-11 14:15:20', '2024-10-14 11:47:10', 3),
(4, '{\"fr\":\"Le 20 Ao\\u00fbt 2020\",\"en\":\"20th August 2020\",\"ln\":\"Le 20 Ao\\u00fbt 2020\"}', '{\"fr\":\"Cr\\u00e9ation de la cha\\u00eene You tube DikiTivi\\n\",\"en\":\"Creation of youtube channel\",\"ln\":null}', NULL, NULL, '2024-10-14 11:58:30', '2024-10-14 11:58:30', 3),
(5, '{\"fr\":\"6 Septembre 2020\",\"en\":\"6th September 2020\",\"ln\":\"6 Septembre 2020\"}', '{\"fr\":\" \\n Cr\\u00e9ation de la cha\\u00eene Facebook DikiTivi\",\"en\":\"creation of Facebook channel\",\"ln\":null}', NULL, NULL, '2024-10-14 12:00:54', '2024-10-14 12:00:54', 3),
(6, '{\"fr\":\"25 D\\u00e9cembre 2020\",\"en\":\"25th December 2020\",\"ln\":\"25 D\\u00e9cembre 2020\"}', '{\"fr\":\" \\n Mise en ligne des premi\\u00e8res vid\\u00e9os.\",\"en\":\"Uploading and publication of first videos.\",\"ln\":null}', NULL, NULL, '2024-10-14 12:03:13', '2024-10-14 12:03:13', 3),
(7, '{\"fr\":\"17 Mars 2021\",\"en\":\"17th March 2021\",\"ln\":\"17 Mars 2021\"}', '{\"fr\":\"Mise en ligne de la premi\\u00e8re version de la webtv DikiTivi avec de Bourdak corporation.\",\"en\":\"launching of the webTv DikiTivi on www.dikitivi.com powered by Bourdak corporation\",\"ln\":null}', NULL, NULL, '2024-10-14 12:07:23', '2024-10-14 12:07:23', 3),
(8, '{\"fr\":\"30 Juin 2022\",\"en\":\"30th June 2022\",\"ln\":\"30 Juin 2022\"}', '{\"fr\":\"Premier direct sur Youtube\",\"en\":\"First Live on the youtube channel\",\"ln\":null}', NULL, NULL, '2024-10-14 12:08:33', '2024-10-14 12:08:33', 3),
(9, '{\"fr\":\"D\\u00e9cembre 2023\",\"en\":\"In December 2023\",\"ln\":\"Na D\\u00e9cembre 2023\"}', '{\"fr\":\"DikTivi \\u00e9largi son contenu pour toucher tous les \\u00e2ges et toute la famille \",\"en\":\"DikiTivi enlarge the contents for familly \",\"ln\":null}', NULL, NULL, '2024-10-14 12:12:26', '2024-10-14 12:12:26', 3),
(10, '{\"fr\":\".\",\"en\":\".\",\"ln\":\".\"}', '{\"fr\":\"Nous recueillons des informations lorsque vous faites un don sur notre site ou que vous vous inscrivez pour \\u00e9crire un commentaire, pour contacter un orateur du site ou encore pour vous inscrire \\u00e0 un \\u00e9v\\u00e9nement ou \\u00e0 un service offert. Les informations recueillies sont uniquement celles que vous nous avez fournies et varient selon les cas.\\nDans le cadre d\\u2019un don par exemple, nous vous demandons votre pays (obligatoire), votre pr\\u00e9nom et nom (obligatoire), votre adresse e-mail (obligatoire), votre num\\u00e9ro de t\\u00e9l\\u00e9phone, votre adresse postale, votre organisme le cas \\u00e9ch\\u00e9ant, et votre mode de paiement.\\nEn outre, nous recevons et enregistrons automatiquement des informations \\u00e0 partir de votre navigateur internet, y compris votre adresse IP, vos logiciels, votre mat\\u00e9riel, et la page que vous visitez.\\n\",\"en\":\"We collect information when you make a donation on our site or register to write a comment, to contact a speaker on the site or to register for an event or service offered. The information collected is only that which you have provided to us and varies from case to case.\\nAs part of a donation for example, we ask you for your country (required), your first and last name (required), your email address (required), your telephone number, your postal address, your organization if applicable , and your payment method.\\nAdditionally, we automatically receive and record information from your internet browser, including your IP address, software, hardware, and the page you are visiting.\",\"ln\":\"Tozwaka makambo ntango opesi likabo na site na biso to okomi nkombo mpo na kokoma makanisi, mpo na kokutana na molobi na site to mpo na kokomisa nkombo mpo na molulu to mosala moko oyo epesami. Ba informations oyo ezuami ezali kaka oyo opesi biso mpe ekeseni na cas na cas.\\nLokola eteni ya likabo na ndakisa, tos\\u025bngaka yo mboka na yo (esengeli), nkombo na yo ya liboso mpe ya nsuka (esengeli), adresi na yo ya email (esengeli), nimero na yo ya telefone, adresi na yo ya posita, ebongiseli na yo soki esengeli , mpe mbongo oyo ofuti metode.\\nLongola yango, tozwaka mpe tok\\u0254taka na ndenge ya automatique makambo oyo euti na navigateur na yo ya internet, bakisa mpe adresi IP na yo, logiciel, mat\\u00e9riel, mpe lokasa oyo ozali kotala.\"}', NULL, NULL, '2024-12-13 16:39:27', '2024-12-13 18:36:40', 4),
(11, '{\"fr\":\"Le site\",\"en\":\"The Site\",\"ln\":\"Site\"}', '{\"fr\":\"Ce site web est \\u00e9dit\\u00e9 par Le Minist\\u00e8re \'\'Divines Kids International\'\'\\nKinshasa, RDC\\n\",\"en\":\"This website is published by \'\'Divines Kids International Ministry\'\'\\nKinshasa, DRC\",\"ln\":\"Site oyo ebimisami na Minist\\u00e8re Divines Kids\\nKinshasa, na RDC\"}', NULL, NULL, '2024-12-13 17:14:39', '2024-12-13 17:14:39', 13),
(12, '{\"fr\":\"Directeur de la publication\",\"en\":\"Director of publication\",\"ln\":\"Directeur ya publication\"}', '{\"fr\":\"Jean Loup Atambutu en qualit\\u00e9 de Coordonnateur du projet DIKI\",\"en\":\"Jean Loup Atambutu as DIKI\'s Project Coordinator\",\"ln\":\"Jean Loup Atambutu\"}', NULL, NULL, '2024-12-13 17:17:21', '2024-12-13 17:17:21', 13),
(13, '{\"fr\":\"Photos\",\"en\":\"Photos\",\"ln\":\"Ba fotos\"}', '{\"fr\":\"Les photos utilis\\u00e9es sur le site et l\'application sont originales libres de droit ou achet\\u00e9es principalement sur des sites sp\\u00e9cialis\\u00e9s avec les droits d\'exploitation. Dans ce cas, elles ne sont utilis\\u00e9es qu\'\\u00e0 des fins purement illustratives et les personnes repr\\u00e9sent\\u00e9es sur les photos ne sont que des mod\\u00e8les.\",\"en\":\"The photos used on the site and the application are original royalty-free or purchased mainly on specialized sites with exploitation rights. In this case, they are used for purely illustrative purposes and the people represented in the photos are only models.\",\"ln\":\"Ba photos oyo tosaleli na site mpe na application ezali originale, ya ofele to esombami mingi mingi na ba sites elongobani oyo epesi biso ndingisa yako salela. Na nzela oyo bato bazali likolo bazali kaka pona bolakisi to ba modele\"}', NULL, NULL, '2024-12-13 17:23:27', '2024-12-13 17:23:27', 13),
(14, '{\"fr\":\"Propri\\u00e9t\\u00e9 intellectuelle\",\"en\":\"Intellectual property\",\"ln\":\"Mayele\"}', '{\"fr\":\"Tous droits r\\u00e9serv\\u00e9s. Toute reproduction est interdite sans autorisation. Tous les textes, photos, vid\\u00e9os, mp3, donn\\u00e9es, logos et autres \\u00e9l\\u00e9ments reproduits sur ce site sont prot\\u00e9g\\u00e9s par le droit d\'auteur selon les r\\u00e8gles de droit Congolais et international.\",\"en\":\"All rights reserved. Any reproduction is prohibited without authorization. All texts, photos, videos, mp3s, data, logos and other elements reproduced on this site are protected by copyright according to the rules of Congolese and international law.\",\"ln\":\"Makoki nyonso mazali ya yo. Kobotama nyonso epekisami kozanga ndingisa. Ba textes, ba photos, ba vid\\u00e9os, ba mp3s, ba donn\\u00e9es, ba logos pe ba \\u00e9l\\u00e9ments mosusu oyo ezongisami na site oyo ebatelami na droit d\\u2019auteur engebene na mibeko ya Congo mpe ya droit international.\"}', NULL, NULL, '2024-12-13 17:26:05', '2024-12-13 17:26:05', 13),
(15, '{\"fr\":\"H\\u00e9bergeur\",\"en\":\"Host\",\"ln\":\"Bisika Diki ebombami\"}', '{\"fr\":\"Le site dikitivi.com,  l\'application, ainsi que les fichiers audio et vid\\u00e9os sont h\\u00e9berg\\u00e9s sur des serveurs que nous louons \\u00e0 la soci\\u00e9t\\u00e9 :Planet hoster, aws et hostinger\",\"en\":\"The dikitivi.com site, the application, as well as the audio and video files are hosted on servers that we rent from the company: Planet hoster, aws and hostinger\",\"ln\":\"Site dikitivi.com pe application, pe lisusu ba fichiers audi, na videos ebombami epayi ya: Planet hoster, aws na hostinger\"}', NULL, NULL, '2024-12-13 17:31:06', '2024-12-13 17:31:06', 13),
(16, '{\"fr\":\"Diffusion sur internet\",\"en\":\"Internet diffusion\",\"ln\":\"Bo panzi na internete\"}', '{\"fr\":\"Les vid\\u00e9os diffus\\u00e9es sur internet (service \\\"replay\\\" et \\u2018\\u2019direct\\u2019\\u2019) sont h\\u00e9berg\\u00e9es et diffus\\u00e9es par \\n-YouTube: https:\\/\\/policies.google.com\\/privacy?hl=en\\n-Dailymotion:  https:\\/\\/legal.dailymotion.com\\/fr\\/conditions-utilisation\\/\\n-AWS:  https:\\/\\/d1.awsstatic.com\\/legal\\/AWS_Site_Terms\\/AWS_Site_Terms_French_2022-09-30.pdf\\n\",\"en\":\"The videos broadcast on the internet (\\u201creplay\\u201d and \\u201cdirect\\u201d service) are hosted and distributed by \\n-YouTube: https:\\/\\/policies.google.com\\/privacy?hl=en\\n-Dailymotion: https:\\/\\/legal.dailymotion.com\\/fr\\/conditions-usage\\/\\n-AWS: https:\\/\\/d1.awsstatic.com\\/legal\\/AWS_Site_Terms\\/AWS_Site_Terms_French_2022-09-30.pdf\",\"ln\":\"Ba vid\\u00e9os oyo epesamaka na internet (\\u201cservice ya replay\\u201d mpe \\u201cdirect\\u201d) eyambamaka mpe ekabolamaka na... YouTube: https:\\/\\/mibeko.google.com\\/bomoi ya moto ye moko?hl=en\\n-Dailymotion: https:\\/\\/mouvement juridique.com\\/fr\\/kosalela-ba conditions\\/\\n-AWS: https:\\/\\/d1.awsstatic.com\\/legal\\/Mibeko_ya_Site_AWS\\/Mibeko_ya_Site_AWS_Fran\\u00e7ais_2022-09-30.pdf\"}', NULL, NULL, '2024-12-13 17:34:05', '2024-12-13 17:34:05', 13),
(17, '{\"fr\":\".\",\"en\":\".\",\"ln\":\".\"}', '{\"fr\":\"Toutes les informations que nous recueillons aupr\\u00e8s de vous peuvent \\u00eatre utilis\\u00e9es pour :\\n\\u2013 Personnaliser votre exp\\u00e9rience et r\\u00e9pondre \\u00e0 vos besoins individuels\\n\\u2013 Am\\u00e9liorer notre site web\\n\\u2013 Am\\u00e9liorer le service aupr\\u00e8s de nos utilisateurs et de nos donateurs et que leurs besoins soient pris en charge\\n\\u2013 Vous contacter par email\\n\\u2013 Administrer un concours, une promotion, ou une enqu\\u00eate.\",\"en\":\"Any information we collect from you may be used to:\\n\\u2013 Personalize your experience and meet your individual needs\\n\\u2013 Improve our website\\n\\u2013 Improve service to our users and donors and ensure their needs are taken care of\\n\\u2013 Contact you by email\\n\\u2013 Administer a contest, promotion, or survey\",\"ln\":\"Ba informations nionso oyo tozuaka epayi na yo ekoki ko mesana na:\\n\\u2013 Personnaliser exp\\u00e9rience na yo mpe kokokisa ba besoins na yo moko moko\\n\\u2013 Kobongisa site internet na biso\\n\\u2013 Kobongisa mosala na basaleli mpe ba donateurs na biso mpe kosala ete bamposa na bango ezwama\\n\\u2013 Bokutana na yo na nzela ya email\\n\\u2013 Kokamba momekano, botomboli, to anketi\"}', NULL, NULL, '2024-12-13 17:36:39', '2024-12-13 17:36:39', 5),
(18, '{\"fr\":\".\",\"en\":\".\",\"ln\":\".\"}', '{\"fr\":\"Nous ne vendons, n\\u2019\\u00e9changeons et ne transf\\u00e9rons pas vos informations personnelles identifiables \\u00e0 des tiers. Cela ne comprend pas les tierces parties de confiance qui nous aident \\u00e0 exploiter notre site internet, tant que ces parties conviennent de garder ces informations confidentielles.\\nNous pensons qu\\u2019il est n\\u00e9cessaire de partager des informations afin d\\u2019enqu\\u00eater, de pr\\u00e9venir ou de prendre des mesures concernant des activit\\u00e9s ill\\u00e9gales, fraudes pr\\u00e9sum\\u00e9es, situations impliquant des menaces potentielles \\u00e0 la s\\u00e9curit\\u00e9 physique de toute personne, violations de nos conditions d\\u2019utilisation, ou quand la loi nous y contraint.\\nLes informations non-priv\\u00e9es, cependant, peuvent \\u00eatre fournies \\u00e0 d\\u2019autres parties majoritairement pour des besoins d\\u2019am\\u00e9lioration de notre site internet.\\n\",\"en\":\"We do not sell, trade, or transfer your personally identifiable information to outside parties. This does not include trusted third parties who assist us in operating our website, so long as those parties agree to keep this information confidential.\\nWe believe it is necessary to share information in order to investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the physical safety of any person, violations of our terms of use, or when the law requires us to do so.\\nNon-private information, however, may be provided to other parties primarily for purposes of improving our website.\",\"ln\":\"Tot\\u025bkaka te, tot\\u025bkaka te, to topesaka te makambo na yo oyo ekoki koyeba yo epai ya bato mosusu. Yango esangisi te bato mosusu oyo batyelaka motema mpe oyo basalisaka biso t\\u00f3salela site Internet na biso, soki bato yango bandimi kobomba makambo yango na sekele.\\nTondimi ete esengeli kokabola makambo mpo na kolukaluka, kopekisa, to kosala likambo oyo etali misala oyo eyokani te na mibeko, oyo bakanisaka ete ezali bokosi, makambo oyo ekoki kobimisa makama mpo na libateli ya nzoto ya moto nyonso, kobuka mibeko na biso ya kosalela, to ntango mobeko es\\u025bngi biso mpo na kosala yango.\\nKasi, bakoki kopesa bato mosusu makambo oyo ezali ya moto ye moko te libosoliboso mpo na kobongisa site Internet na biso.\"}', NULL, NULL, '2024-12-13 17:38:19', '2024-12-13 17:38:19', 6),
(19, '{\"fr\":\".\",\"en\":\".\",\"ln\":\".\"}', '{\"fr\":\"Nous mettons en \\u0153uvre une vari\\u00e9t\\u00e9 de mesures de s\\u00e9curit\\u00e9 pour pr\\u00e9server la s\\u00e9curit\\u00e9 de vos informations personnelles. Seuls les employ\\u00e9s qui ont besoin d\\u2019effectuer un travail sp\\u00e9cifique ont acc\\u00e8s aux informations personnelles identifiables. Les ordinateurs et serveurs utilis\\u00e9s pour stocker des informations personnelles identifiables sont conserv\\u00e9s dans un environnement s\\u00e9curis\\u00e9.\\nAucune information bancaire n\\u2019est enregistr\\u00e9e dans nos bases de donn\\u00e9es hormis les coordonn\\u00e9es bancaires.\\nEst-ce que nous utilisons des cookies ? Oui. Nos cookies am\\u00e9liorent l\\u2019acc\\u00e8s \\u00e0 notre site et identifient les visiteurs r\\u00e9guliers. En outre, nos cookies am\\u00e9liorent l\\u2019exp\\u00e9rience d\\u2019utilisateur gr\\u00e2ce au suivi et au ciblage de ses int\\u00e9r\\u00eats. Cependant, cette utilisation des cookies n\\u2019est en aucune fa\\u00e7on li\\u00e9e \\u00e0 des informations personnelles identifiables sur notre site.\\n\",\"en\":\"We implement a variety of security measures to keep your personal information safe. Only employees who need to perform specific work have access to personally identifiable information. Computers and servers used to store personally identifiable information are kept in a secure environment.\\nNo banking information is recorded in our databases other than bank details.\\nDo we use cookies? Yes. Our cookies improve access to our site and identify repeat visitors. In addition, our cookies improve the user experience by tracking and targeting their interests. However, this use of cookies is in no way linked to any personally identifiable information on our site.\",\"ln\":\"Tosalelaka bibongiseli ndenge na ndenge ya kobatela makambo na yo mpo na kobatela makambo na yo. Kaka basali oyo basengeli kosala mosala moko boye nde bakoki kozwa makambo oyo ekoki koyeba moto. Baordinat\\u025br\\u025b mpe ba serveurs oyo basalelaka mpo na kobomba makambo oyo ekoki koyeba moto ebombami na esika oyo ezali na libateli.\\nBa informations ya banque moko te ekomami na ba bases de donn\\u00e9es na biso longola se ba d\\u00e9tails ya banque.\\nTosalelaka ba cookies? Iyo. Ba cookie na biso ebongisaka nzela ya kok\\u0254ta na site na biso mpe emonisaka bato oyo bazongelaka kotala site na biso. En plus, ba cookies na biso ebongisaka exp\\u00e9rience ya usager na kolandela pe ko cibler ba int\\u00e9r\\u00eats na bango. Kasi, ndenge wana ya kosalela ba cookies ezali na boyokani ata moke te na makambo oyo ekoki koyeba yo na site na biso.\"}', NULL, NULL, '2024-12-13 17:40:17', '2024-12-13 17:40:17', 7),
(20, '{\"fr\":\".\",\"en\":\".\",\"ln\":\".\"}', '{\"fr\":\"Nous nous engageons \\u00e0 vous offrir un droit d\\u2019opposition et de retrait quant \\u00e0 vos renseignements personnels. Le droit d\\u2019opposition s\\u2019entend comme \\u00e9tant la possibilit\\u00e9 offerte aux internautes de refuser que leurs renseignements personnels soient utilis\\u00e9s \\u00e0 certaines fins mentionn\\u00e9es lors de la collecte. Le droit de retrait s\\u2019entend comme \\u00e9tant la possibilit\\u00e9 offerte aux internautes de demander \\u00e0 ce que leurs renseignements personnels ne figurent plus, par exemple, dans une liste de diffusion.\\nPour exercer ce droit de retrait de vos informations, veuillez nous \\u00e9crire en vous rendant sur la page contact de notre site internet.\\n\",\"en\":\"We are committed to offering you the right to object and withdraw your personal information. The right to object is understood as the possibility offered to Internet users to refuse that their personal information be used for certain purposes mentioned during collection. The right of withdrawal is understood as the possibility offered to Internet users to request that their personal information no longer appear, for example, in a mailing list.\\nTo exercise this right to withdraw your information, please write to us by going to the contact page of our website.\",\"ln\":\"Tozali na mokano ya kopesa yo lotomo ya koboya mpe kolongola makambo na yo. Lotomo ya koboya esosolami lokola likoki oyo epesami na basaleli ya Internet mpo na koboya ete makambo na bango ya moto esalelamaka mpo na makambo mosusu oyo balobeli ntango bazali kozwa yango. Lotomo ya kolongolama esosolami lokola likoki oyo epesami na basaleli ya Internet mpo na kosenga ete makambo na bango ya moto ebima lisusu te, na ndakisa, na liste ya bamesaje.\\nMpo na kosalela lotomo oyo ya kolongola makambo na yo, komela biso na kokend\\u00e1k\\u00e1 na lokasa ya kosolola na site Internet na biso.\"}', NULL, NULL, '2024-12-13 17:42:06', '2024-12-13 17:42:06', 8),
(21, '{\"fr\":\".\",\"en\":\".\",\"ln\":\".\"}', '{\"fr\":\"Les paiements en ligne ne font pas l\\u2019objet d\\u2019un droit de r\\u00e9tractation. Tout paiement est ferme et d\\u00e9finitif.\\nLes paiements r\\u00e9alis\\u00e9s par les donateurs ne donnent lieu \\u00e0 aucun remboursement.\\n\",\"en\":\"Online payments are not subject to a right of withdrawal. All payment is firm and final.\\nPayments made by donors do not give rise to any refund.\",\"ln\":\"Kofuta na nzela ya internet ezali na lotomo ya kobimisa mbongo te. Lifuta nyonso ezali ferme mpe final.\\nBafutami oyo ba donateurs bafutaka epesaka nzela te na kozongisa mbongo.\"}', NULL, NULL, '2024-12-13 17:44:02', '2024-12-13 17:44:02', 9),
(22, '{\"fr\":\".\",\"en\":\".\",\"ln\":\".\"}', '{\"fr\":\"Nous nous engageons \\u00e0 reconna\\u00eetre un droit d\\u2019acc\\u00e8s et de rectification aux personnes concern\\u00e9es d\\u00e9sireuses de consulter, modifier, voire radier les informations les concernant.\\nPour exercer ce droit d\\u2019acc\\u00e8s veuillez nous \\u00e9crire en vous rendant sur la page contact de notre site internet.\\n\",\"en\":\"We undertake to recognize a right of access and rectification to those concerned wishing to consult, modify or even delete information concerning them.\\nTo exercise this right of access, please write to us by going to the contact page of our website.\",\"ln\":\"Tozali komipesa na kondima lotomo ya kozwa mpe kobongisa na bato oyo bazali na likambo yango oyo balingi kotala, kobongisa to kutu kolongola makambo oyo etali bango.\\nMpo na kosalela lotomo yango ya kok\\u0254ta, tos\\u025bngi yo okomela biso na kokend\\u00e1k\\u00e1 na lokasa ya kosolola na site Internet na biso.\"}', NULL, NULL, '2024-12-13 17:46:34', '2024-12-13 17:46:34', 10),
(23, '{\"fr\":\".\",\"en\":\".\",\"ln\":\".\"}', '{\"fr\":\"Nous utilisons l\\u2019adresse e-mail que vous fournissez pour vous envoyer des informations et mises \\u00e0 jour relatives \\u00e0 votre don, des nouvelles de notre minist\\u00e8re (si vous avez choisi de recevoir de nos nouvelles), etc. Si \\u00e0 n\\u2019importe quel moment vous souhaitez vous d\\u00e9sinscrire et ne plus recevoir d\\u2019e-mails, des instructions de d\\u00e9sabonnement d\\u00e9taill\\u00e9es sont incluses en bas de chaque e-mail, ou bien \\u00e9crivez-nous par e-mail \\u00e0 contact@dikitivi.com\",\"en\":\"We use the email address you provide to send you information and updates related to your donation, news from our ministry (if you have opted in to receive news from us), etc. If at any time you would like to unsubscribe from receiving emails, detailed unsubscribe instructions are included at the bottom of each email, or alternatively email us at contact@dikitivi. com.\",\"ln\":\"Tosalelaka adresse email oyo opesi mpo na kotindela yo ba informations mpe ba mises \\u00e0 jour oyo etali likabo na yo, ba sango ya minist\\u00e8re na biso (soki oponi kozua ba sango epai na biso), etc. Soki na ntango moko boye olingi kotika kozwa ba email, malako ya sikisiki ya kotika abonn\\u00e9ment ezali na nse ya email moko na moko, to tindela biso email na contact@dikitivi com.\"}', NULL, NULL, '2024-12-13 17:50:33', '2024-12-13 17:50:33', 11),
(24, '{\"fr\":\".\",\"en\":\".\",\"ln\":\".\"}', '{\"fr\":\"En utilisant notre site ou notre application, vous consentez implicitement \\u00e0 nos conditions g\\u00e9n\\u00e9rales d\\u2019utilisation, ainsi que celle de You tube, dailymotion. \\nNous vous invitons \\u00e0 consulter les conditions g\\u00e9n\\u00e9rales d\\u2019utilisation de You tube \\u00e0 cette adresse: https:\\/\\/policies.google.com\\/privacy?hl=en\\n\",\"en\":\"By using our site or our application, you implicitly consent to our general conditions of use, as well as those of You tube, dailymotion. \\nWe invite you to consult the general conditions of use of You Tube at this address: https:\\/\\/policies.google.com\\/privacy?hl=en\",\"ln\":\"Soki osaleli site na biso to application na biso, ondimi na ndenge ya polele mibeko na biso ya kosalela, bakisa mpe oyo ya You tube, dailymotion. \\nTobengisi yo otala ba conditions g\\u00e9n\\u00e9rales ya usage ya You Tube na adresse oyo: https:\\/\\/policies.google.com\\/privacy?hl=en\"}', NULL, NULL, '2024-12-13 17:52:33', '2024-12-13 17:52:33', 12),
(25, '{\"fr\":\"Pr\\u00e9ambule\",\"en\":\"Pr\\u00e9ambule\",\"ln\":\"Pr\\u00e9ambule\"}', '{\"fr\":\"\\nEn naviguant sur le site DIKITIVI ou en utilisant n\'importe quel service propos\\u00e9 par DIKITIVI (tels que d\\u00e9finis ci-dessous), vous acceptez d\'\\u00eatre li\\u00e9(e) par les conditions g\\u00e9n\\u00e9rales suivantes (les \\u00ab Conditions d\'utilisation \\u00bb), ci-apr\\u00e8s \\u00ab CGU \\u00bb.\\n\\nTels qu\'utilis\\u00e9s dans les pr\\u00e9sentes Conditions d\'utilisation, les termes \\u00ab nous \\u00bb, \\u00ab nos \\u00bb et \\u00ab DIKITIVI \\u00bb d\\u00e9signent la Partie contractante DIKI concern\\u00e9e (telle que d\\u00e9finie \\u00e0 la section 2 ci-dessous).\\n\\nL\'utilisation des donn\\u00e9es personnelles est r\\u00e9gie par la charte de confidentialit\\u00e9 des utilisateurs.\\n\\nToute l\'utilisation de la rubrique \\u00ab Faire un don \\u00bb est r\\u00e9gie par nos conditions g\\u00e9n\\u00e9rales des dons et par la charte des droits du donateur.\\n\\nDIKITIVI se r\\u00e9serve le droit de mettre \\u00e0 jour ou modifier, sans pr\\u00e9avis, les Conditions d\'utilisation, en publiant les mises \\u00e0 jour et modifications sur le site Web de DIKITIVI. Il est de la responsabilit\\u00e9 de l\'utilisateur de consulter les conditions d\'utilisation de temps \\u00e0 autre, pour conna\\u00eetre les mises \\u00e0 jour ou modifications susceptibles de le concerner. Si l\'utilisateur n\'accepte pas ces modifications, il doit cesser d\'utiliser les Services.\\n\\n\",\"en\":null,\"ln\":null}', NULL, NULL, '2024-12-13 17:57:10', '2024-12-15 22:46:31', 14),
(26, '{\"fr\":\".\",\"en\":\".\",\"ln\":\".\"}', '{\"fr\":\"Par ce Don, vous contribuerez non seulement \\u00e0 l\\u2019expansion de l\\u2019Evangile, faisant de par le monde ainsi que de tous les \\u00e2ges des disciples du Christ, mais aussi vous permettrez \\u00e0 des milliers de familles d\\u2019avoir acc\\u00e8s gratuitement, pour leurs divertissements, \\u00e0 des  contenus Sains, Amusants, Instructifs et Divins. \\nNous prions, qu\\u2019au nom puissant de J\\u00e9sus Christ,  vous soyez b\\u00e9nis et qu\\u2019il vous soit constitu\\u00e9 des richesses intemporelles sur terre et dans les lieux c\\u00e9lestes.\\n\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\tEquipe DikiTivi\\n\",\"en\":\"Through this Gift, you will not only contribute to the expansion of the Gospel, making disciples of Christ throughout the world and all ages, but also you will allow thousands of families to have free access, for their entertainment, Healthy, Fun, Educational and Divine content. \\nWe pray, that in the mighty name of Jesus Christ, may you be blessed with timeless riches on earth and in heavenly places.\\n\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\tDikiTivi Team\",\"ln\":\"Na nzela ya Likabo oyo, okopesa kaka te mpo na kopanzana ya Nsango Malamu, kokomisa bayekoli ya Klisto na mokili mobimba mpe na mibu nyonso, kasi lisusu okopesa nzela na bankoto ya mabota kozala na nzela ya ofele, mpo na kominanola na bango, Sant\\u00e9, Esengo, Eteyelo mpe Contenu ya bonzambe. \\nTobondeli, ete na nkombo ya nguya ya Yesu Klisto, tika ete bopambolama na bomengo oyo ezanga ntango na mabele mpe na bisika ya lola.\\n\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\tEquipe ya DikiTivi\"}', NULL, NULL, '2024-12-13 18:02:04', '2024-12-13 18:02:04', 15),
(27, '{\"fr\":\"D\\u00e9finitions\",\"en\":\"Definition\",\"ln\":\"Definition\"}', '{\"fr\":\"Les termes ci-dessous d\\u00e9finis ont la signification qui leur est attribu\\u00e9e ci-apr\\u00e8s :\\n\\nAnnexe : d\\u00e9signe toute annexe aux pr\\u00e9sentes CGU.\\n\\nCGU (conditions g\\u00e9n\\u00e9rales d\'utilisation) : d\\u00e9signe le pr\\u00e9sent document, ses annexes ainsi que ses \\u00e9ventuels avenants ult\\u00e9rieurs.\\n\\nContenu : d\\u00e9signe les textes, photos, vid\\u00e9os et toute autre forme de contenu mis en ligne par DIKITIVI.\\n\\nMinist\\u00e8res chr\\u00e9tiens : d\\u00e9signe toute assembl\\u00e9e chr\\u00e9tienne, organisme sans but lucratif ayant une nature religieuse, ou poursuivant le partage du message de l\'\\u00c9vangile sous toutes ses formes.\\n\\nLogo : d\\u00e9signe le logo destin\\u00e9 \\u00e0 l\'identification de DIKI, de DIKITIVI ou d\'un Organisme aupr\\u00e8s du public.\\n\\nPartenaire \\/ Donateur : d\\u00e9signe une personne ou un organisme qui soutient financi\\u00e8rement DIKITIVI.\\n\\nPropri\\u00e9t\\u00e9 intellectuelle : d\\u00e9signe tout \\u00e9l\\u00e9ment susceptible de protection par le droit de la propri\\u00e9t\\u00e9 intellectuelle ou industrielle, tels que notamment, le logo, la marque et les contenus originaux de DIKITIVI.\\nUtilisateur : d\\u00e9signe un internaute navigant sur le site ou sur l\\u2019application.\\nDIKITIVI: d\\u00e9signe la plateforme de vid\\u00e9o-streaming de l\\u2019organisme  sans but lucratif DIKI.\\nService : d\\u00e9signe toute fonctionnalit\\u00e9 que propose le site Internet\\/l\\u2019application.\\n\",\"en\":null,\"ln\":null}', NULL, NULL, '2024-12-15 22:48:01', '2024-12-15 22:48:01', 14),
(28, '{\"fr\":\"Nos services\",\"en\":\"Our services\",\"ln\":\"Ba servisi na biso\"}', '{\"fr\":\"DIKI  (Divines Kids International) est un organisme de bienfaisance chr\\u00e9tien, initi\\u00e9 en RDC depuis 2020 et dont la vision est de faire des enfants de tous les \\u00e2ges, de toutes les nations,  des disciples du Christ et des vases d\'honneurs, ce via les m\\u00e9dias qui leurs permettent de se divertir dans le Seigneur.\\nDIKITIVI est une plateforme de vid\\u00e9o-streaming qui met \\u00e0 disposition de ses utilisateurs un service en ligne dikitivi.com  et une application DIKITIVI,  leur permettant de visualiser tous les contenus du Minist\\u00e8re Divines Kids International. Les programmes diffus\\u00e9s sont con\\u00e7us par les \\u00e9quipes de DIKITIVI ou produits par d\'autres minist\\u00e8res chr\\u00e9tiens, sous forme d\'\\u00e9missions audiovisuelles (pr\\u00e9enregistr\\u00e9es ou en direct), de podcasts, de musiques, de dessins anim\\u00e9s, etc. (liste non exhaustive). \\nLes services et contenus sont mis \\u00e0 disposition gratuitement. DIKI est un organisme socio-financ\\u00e9 qui d\\u00e9pend de la g\\u00e9n\\u00e9rosit\\u00e9 de ses donateurs r\\u00e9partis dans le monde entier. L\'utilisateur qui souhaite faire un don se rend sur la page \\u00ab Faire un don \\u00bb et suit les instructions. Les dons sont r\\u00e9gis par les conditions g\\u00e9n\\u00e9rales des dons.  \\n\",\"en\":null,\"ln\":null}', NULL, NULL, '2024-12-15 22:49:34', '2024-12-15 22:49:34', 14),
(29, '{\"fr\":\"R\\u00e9sponsabilit\\u00e9s de DIKI\",\"en\":\"Responsability of DIKI\",\"ln\":\"Mawe ekotala DIKI\"}', '{\"fr\":\"Le contenu\\n\\nL\'ensemble du contenu diffus\\u00e9 par DIKI au travers de son site Internet ou son application  est en lien direct avec l\'objet que l\'organisme entend poursuivre. Notre \\u00e9quipe \\u00e9ditoriale v\\u00e9rifie chaque contenu scrupuleusement, afin de v\\u00e9rifier qu\'aucune discrimination ou fausse information ne soit diffus\\u00e9e.\\nToutefois, les invit\\u00e9s de nos \\u00e9missions, annonceurs, pr\\u00e9dicateurs ou associations partenaires demeurent seuls responsables de leurs d\\u00e9clarations. \\nLe contenu, les donn\\u00e9es, les images et les vid\\u00e9os figurant sur ce site sont la propri\\u00e9t\\u00e9 exclusive de DIKITIVI et, \\u00e0 ce titre, ne peuvent \\u00eatre redistribu\\u00e9s, copi\\u00e9s ou modifi\\u00e9s, alt\\u00e9r\\u00e9s ou utilis\\u00e9s, sans l\'autorisation \\u00e9crite pr\\u00e9alable expresse de DIKITIVI.\\nL\'utilisation, la modification ou le lien vers des images, photos, vid\\u00e9os, histoires et autres contenus trouv\\u00e9s sur ce Site ou sur l\\u2019application de DIKITIVI sans l\'autorisation \\u00e9crite pr\\u00e9alable expresse de DIKI est strictement interdite. De temps \\u00e0 autre, les informations affich\\u00e9es sur ce site ou sur d\'autres sites Web de DIKI pourraient s\'av\\u00e9rer incorrectes ou incompl\\u00e8tes. \\n\\nLes utilisateurs du site dikitivi.com ou de l\\u2019application DIKITIVI ou tout autre site exploit\\u00e9 par DIKI sont seuls responsables des d\\u00e9cisions qu\'ils prennent suite \\u00e0 la consultation des informations disponibles sur le site dikitivi.com. Ils sont invit\\u00e9s \\u00e0 consulter \\u00e9galement d\'autres sources d\'information et \\u00e0 effectuer leurs propres recherches. DIKITIVI ne peut voir sa responsabilit\\u00e9 engag\\u00e9e sur les contenus diffus\\u00e9s dont il n\'est pas l\'auteur, mais dont les droits lui ont \\u00e9t\\u00e9 c\\u00e9d\\u00e9s. Les informations pr\\u00e9sent\\u00e9es sur le site \\u00e9tant soumises \\u00e0 de rapides changements, DIKITIVI d\\u00e9cline toute responsabilit\\u00e9 quant au contenu et ne garantit pas la v\\u00e9racit\\u00e9 ni l\'exhaustivit\\u00e9 de ces informations. \\nEn utilisant le site, l\'utilisateur accepte de d\\u00e9gager DIKI, ses administrateurs et b\\u00e9n\\u00e9voles ou affili\\u00e9s, de tout dommage r\\u00e9sultant de telles erreurs ou omissions. Le site ou l\\u2019application peut contenir des liens vers des sites Web tiers. DIKITIVI n\'est pas responsable des pratiques de confidentialit\\u00e9 ou du contenu de ces derniers.\\nL\'utilisateur sera redirig\\u00e9 vers le site YouTube, le cas \\u00e9ch\\u00e9ant, pour le visionnement des vid\\u00e9os. L\'utilisateur est inform\\u00e9 des conditions g\\u00e9n\\u00e9rales d\'utilisation propres \\u00e0 YouTube et accepte de s\'y conformer.\\n\\nHormis l\'adresse email et les noms n\\u00e9cessaire \\u00e0 l\'envoi des news letter, infos,  (facultative),pour ce qui s\\u2019agit, aucune autre donn\\u00e9e personnelle n\'est demand\\u00e9e. L\'utilisateur a la possibilit\\u00e9 de se d\\u00e9sinscrire de ce service ou modifier ses pr\\u00e9f\\u00e9rences \\u00e0 tout moment, en cliquant sur le lien pr\\u00e9vu \\u00e0 cet effet, directement dans la lettre de nouvelles qu\'il re\\u00e7oit.\\n\\nLiens hypertextes\\n\\nDes liens sont disponibles sur les Services ou \\u00e0 partir des services et qui redirigent vers d\'autres sites Web ou d\'autres sources Internet.\\nLe site dikitivi.com n\'a pas le contr\\u00f4le ni la responsabilit\\u00e9 des sites Web de tiers ou documents externes vers lesquels redirigent ces liens. Ces sites Web, documents et contenus de toute nature sont susceptibles d\'\\u00eatre modifi\\u00e9s, mis \\u00e0 jour ou supprim\\u00e9s \\u00e0 tout moment par l\'\\u00e9diteur qui prend la responsabilit\\u00e9 de leur accessibilit\\u00e9 au public. DIKITIVI n\'exerce pas de contr\\u00f4le sur la formulation de ces liens, ni sur le contenu des sites vers lesquels ils renvoient et ne peut donc \\u00eatre tenu responsable de ce fait.\\n\\nIndisponibilit\\u00e9 de nos services\\n\\nLe site dikitivi.com met tout en \\u0153uvre pour \\u00eatre disponible \\u00e0 chaque instant et partout dans le monde. Toutefois, compte tenu des besoins de maintenance ou pour d\'autres raisons, il peut arriver que les services soient momentan\\u00e9ment indisponibles ; DIKITIVI ne saurait en aucun cas \\u00eatre tenu responsable des inconv\\u00e9nients \\u00e9ventuels r\\u00e9sultant de l\'indisponibilit\\u00e9 du site.\\n\",\"en\":null,\"ln\":null}', NULL, NULL, '2024-12-15 22:53:14', '2024-12-15 22:53:14', 14),
(30, '{\"fr\":\"Responsabilit\\u00e9 des utilisateurs \",\"en\":\"users responsability\",\"ln\":\"Maye makotala basaleli\"}', '{\"fr\":\"  \\n4.1 R\\u00e8gles de conduite \\u00e0 respecter\\nL\'utilisateur s\'interdit de se livrer \\u00e0 des actes, de quelque nature que ce soit (notamment \\u00e0 des actes d\'envoi, diffusion, \\u00e9dition, \\u00e9mission, mise en ligne, publication ou de toute autre mani\\u00e8re), qui seraient ill\\u00e9gaux, porteraient atteinte \\u00e0 l\'ordre public, ou aux droits d\'un tiers. En particulier, et sans que cette liste soit limitative, l\'utilisateur s\'interdit de :\\n\\ntenter d\'induire en erreur d\'autres utilisateurs en usurpant l\'identit\\u00e9 ou une d\\u00e9nomination sociale ou en portant atteinte \\u00e0 l\'image ou \\u00e0 la r\\u00e9putation d\'autres personnes et\\/ou en se faisant passer pour un tiers ou pour un employ\\u00e9, un service habilit\\u00e9 ou un affili\\u00e9 de DIKITIVI;\\nse livrer \\u00e0 une violation des droits de propri\\u00e9t\\u00e9 intellectuelle (notamment en mati\\u00e8re de musique, vid\\u00e9o, animations, jeux, logiciels, bases de donn\\u00e9es, images, sons et textes) ou tout autre droit de propri\\u00e9t\\u00e9 appartenant \\u00e0 autrui ;\\nt\\u00e9l\\u00e9charger sciemment, afficher, \\u00e9mettre, diffuser, transmettre ou rendre accessible de toute autre mani\\u00e8re, tout contenu comprenant ou constituant des virus informatiques ou tout autre code ou programme informatique con\\u00e7us pour interrompre, d\\u00e9truire, d\\u00e9tourner ou limiter les fonctionnalit\\u00e9s ou les performances de tout logiciel, ordinateur, service ou outil de communications \\u00e9lectroniques, sans que cette \\u00e9num\\u00e9ration ne soit limitative ;\\nperturber, ralentir, bloquer ou alt\\u00e9rer le flux normal des donn\\u00e9es \\u00e9chang\\u00e9es dans le cadre du Service, acc\\u00e9l\\u00e9rer le rythme de d\\u00e9filement des contenus du service de telle mani\\u00e8re que le fonctionnement du service soit modifi\\u00e9 ou alt\\u00e9r\\u00e9, ou commettre toute autre action ayant un effet perturbateur \\u00e9quivalent sur les fonctionnalit\\u00e9s du Service ;\\nacc\\u00e9der frauduleusement, se maintenir, entraver ou perturber les syst\\u00e8mes d\'information de DIKITIVI et notamment des Services, les serveurs, les r\\u00e9seaux connect\\u00e9s au Service, ou refuser de se conformer aux conditions requises, aux proc\\u00e9dures, aux r\\u00e8gles g\\u00e9n\\u00e9rales ou aux dispositions r\\u00e9glementaires applicables aux r\\u00e9seaux connect\\u00e9s au Service.\\n\",\"en\":null,\"ln\":null}', NULL, NULL, '2024-12-15 22:56:34', '2024-12-15 22:56:34', 14),
(31, '{\"fr\":\"Signalement des abus\",\"en\":\"Signalement des abus\",\"ln\":\"Signalement des abus\"}', '{\"fr\":\"Si l\'utilisateur constate ou estime que du contenu stock\\u00e9 sur le site ou l\\u2019application  DIKITIVI pr\\u00e9sente un caract\\u00e8re manifestement illicite, il peut le signaler en envoyant un email \\u00e0 : alerte@dikitivi.com. \\nLa notification doit imp\\u00e9rativement permettre \\u00e0 DIKITIVI d\'identifier le contenu illicite et le chemin d\'acc\\u00e8s \\u00e0 ce contenu. Cette notification doit contenir les \\u00e9l\\u00e9ments ci-dessous :\\nvos noms, pr\\u00e9noms et lieu de domicile ;\\nune copie du contenu qui vous semble litigieux (ex : par une capture d\'\\u00e9cran) ainsi que l\'adresse URL de la page concern\\u00e9e ou les nom et pr\\u00e9nom de l\'auteur du contenu litigieux ;\\nles motifs pour lesquels vous pensez que le contenu doit \\u00eatre retir\\u00e9.\\nToute notification d\'un contenu abusivement pr\\u00e9sent\\u00e9 comme illicite dans le but d\'en obtenir le retrait exposerait l\'utilisateur \\u00e0 des poursuites et\\/ ou sanctions civiles et\\/ou p\\u00e9nales.\\n\\n\",\"en\":null,\"ln\":null}', NULL, NULL, '2024-12-15 22:57:28', '2024-12-15 22:57:28', 14),
(32, '{\"fr\":\"Copyright et propri\\u00e9t\\u00e9 intellectuelle\",\"en\":\"Copyright et propri\\u00e9t\\u00e9 intellectuelle\",\"ln\":\"Copyright et propri\\u00e9t\\u00e9 intellectuelle\"}', '{\"fr\":\"Droits de propri\\u00e9t\\u00e9 intellectuelle DIKITIVI:\\nToutes les informations, \\u00e9crans, graphismes, donn\\u00e9es, textes, logiciels, musiques, sons, photographies, images, vid\\u00e9os, messages, avis, opinions, ou commentaires de toute sorte ou tout autre mat\\u00e9riel pr\\u00e9sent sur dikitivi.com sont la propri\\u00e9t\\u00e9 exclusive de DIKITIVI. De ce fait, toute reproduction, modification, distribution de ces \\u00e9l\\u00e9ments est interdite sans l\'accord pr\\u00e9alable expr\\u00e8s de DIKI. Pour obtenir un tel accord, veuillez \\u00e9crire \\u00e0 contact@dikitivi.com. \\nLes services ainsi que tout logiciel, contenu ou mat\\u00e9riel utilis\\u00e9 par DIKITIVI en relation avec les services (ci-apr\\u00e8s d\\u00e9nomm\\u00e9 \\u00ab logiciels \\u00bb) contiennent des informations confidentielles qui sont prot\\u00e9g\\u00e9es, notamment par le code de la propri\\u00e9t\\u00e9 intellectuelle. \\nAinsi, les contenus des services sont prot\\u00e9g\\u00e9s au titre du droit de la propri\\u00e9t\\u00e9 intellectuelle pour la et le monde entier.\\n\\nEn acceptant les CGU, l\'utilisateur s\'engage \\u00e0 utiliser tout logiciel, contenu ou mat\\u00e9riel appartenant \\u00e0 DIKI pour un usage strictement priv\\u00e9 et personnel, limit\\u00e9 au cercle de famille, \\u00e0 des fins l\\u00e9gales et conform\\u00e9ment aux lois et aux r\\u00e8glements locaux, nationaux ou internationaux.\\nToute autre utilisation, sauf autorisation pr\\u00e9alable de DIKITIVI et\\/ou des autres ayants-droit, est constitutive de contrefa\\u00e7on et sanctionn\\u00e9e au titre de la propri\\u00e9t\\u00e9 intellectuelle.\\nToute reproduction totale ou partielle de tout ou partie des \\u00e9l\\u00e9ments pr\\u00e9sents sur les pages des services non autoris\\u00e9s est strictement interdite.\\n\\nEn aucune mesure il ne vous est possible d\'utiliser ou de diffuser de quelque mani\\u00e8re que ce soit, le logo de DIKITIVI et tout autre visuel identifiant les \\u00e9missions produites par DIKITIVI pr\\u00e9cit\\u00e9es, sans l\'accord expr\\u00e8s de DIKITIVI. Toute reproduction non autoris\\u00e9e est passible de poursuites aupr\\u00e8s des autorit\\u00e9s judiciaires. Pour obtenir un tel accord, veuillez \\u00e9crire \\u00e0 contact@dikitivi.com.\\n\",\"en\":null,\"ln\":null}', NULL, NULL, '2024-12-15 22:59:43', '2024-12-15 22:59:43', 14),
(33, '{\"fr\":\"Autres dispositions: Ill\\u00e9galit\\u00e9 d\'une clause\",\"en\":\"Autres dispositions: Ill\\u00e9galit\\u00e9 d\'une clause\",\"ln\":\"Autres dispositions: Ill\\u00e9galit\\u00e9 d\'une clause\"}', '{\"fr\":\"\\nLe fait qu\'une disposition de ces conditions g\\u00e9n\\u00e9rales d\'utilisation du site Internet dikitivi.com ou de l\\u2019application DIKITIVI se r\\u00e9v\\u00e8le \\u00eatre, en totalit\\u00e9 ou en partie, illicite ou inapplicable pour quelque raison que ce soit, sera sans incidence sur la validit\\u00e9 des autres clauses des pr\\u00e9sentes conditions d\'utilisation.\\n\\n\",\"en\":null,\"ln\":null}', NULL, NULL, '2024-12-15 23:01:25', '2024-12-15 23:01:25', 14),
(34, '{\"fr\":\"Autres dispositions: Indemnisation\",\"en\":\"Autres dispositions: Indemnisation\",\"ln\":\"Autres dispositions: Indemnisation\"}', '{\"fr\":\"\\nAu titre de l\'utilisation du site et de l\\u2019application de DIKITIVI, l\'utilisateur accepte de l\\u2019indemniser, ses fournisseurs, ses employ\\u00e9s, ses dirigeants et autres tierces parties de tous les dommages directs, indirects, cons\\u00e9cutifs, sp\\u00e9ciaux, fortuits, accessoires, exemplaires, de toute perte, toute demande de dommages-int\\u00e9r\\u00eats, incluant les honoraires d\'avocat et autres frais judiciaires, occasionn\\u00e9s par l\'utilisateur ou tout tiers r\\u00e9sultant de ou \\u00e9tant associ\\u00e9 \\u00e0 toute utilisation du logiciel et\\/ou r\\u00e9sultant de toute violation des \\u00ab Conditions G\\u00e9n\\u00e9rales d\'utilisation \\u00bb.\\n\",\"en\":null,\"ln\":null}', NULL, NULL, '2024-12-15 23:03:41', '2024-12-15 23:03:41', 14),
(35, '{\"fr\":\"Autres dispositions: Cession des droits\",\"en\":\"Autres dispositions: Cession des droits\",\"ln\":\"Autres dispositions: Cession des droits\"}', '{\"fr\":\"\\nEn cas de fusion de l\'organisme DIKI avec une tierce partie, DIKI se r\\u00e9serve le droit de c\\u00e9der tout ou partie de ses droits et obligations au titre des pr\\u00e9sentes conditions d\'utilisation \\u00e0 ladite tierce partie ou \\u00e0 la nouvelle entit\\u00e9 r\\u00e9sultant de la fusion.\\nL\'utilisateur est inform\\u00e9 qu\'une telle fusion n\'entra\\u00eenera pas la caducit\\u00e9 des pr\\u00e9sentes CGU.\\n\\n\\n\",\"en\":null,\"ln\":null}', NULL, NULL, '2024-12-15 23:05:08', '2024-12-15 23:05:08', 14),
(36, '{\"fr\":\"Autres dispositions\",\"en\":\"Autres dispositions\",\"ln\":\"Autres dispositions\"}', '{\"fr\":\"**6.4 Informations compl\\u00e9mentaires**\\n\\nToutes les questions concernant les services propos\\u00e9s par DIKITIVI sont les bienvenues et peuvent \\u00eatre pos\\u00e9es par email \\u00e0 contact@dikitivi.com. \\n\\n**6.5 Droit applicable et litiges**\\nLes pr\\u00e9sentes CGU sont entr\\u00e9es en vigueur le 29 Mars 2024 et sont r\\u00e9gies, interpr\\u00e9t\\u00e9es et appliqu\\u00e9es, conform\\u00e9ment au droit Congolais.\\nSi l\'utilisation du site dikitivi.com ou de l\\u2019application contrevient \\u00e0 la l\\u00e9gislation du pays dans lequel r\\u00e9side l\'utilisateur, il convient pour celui-ci de ne pas les utiliser. Il est le mieux plac\\u00e9 pour juger de l\'opportunit\\u00e9 et de la l\\u00e9galit\\u00e9 de cette utilisation. L\'utilisation du site dikitivi.com  ou de l\\u2019application DIKITIVI se fait aux propres risques de chaque utilisateur.\\nDIKITIVI fera tout son possible pour trouver les moyens satisfaisants de r\\u00e9soudre les probl\\u00e8mes rencontr\\u00e9s sur son site\\/application. Si cela ne s\'av\\u00e9rait pas possible, DIKITIVI pourrait solliciter une m\\u00e9diation, un arbitrage, ou l\'introduction d\'une instance aupr\\u00e8s d\'un tribunal.\\n\\n**6.6 Assistance**\\nEn cas de r\\u00e9clamation, de plainte \\u00e9manant de tiers ou d\'action judiciaire form\\u00e9e \\u00e0 l\'encontre de DIKITIVI, ses repr\\u00e9sentants, ses salari\\u00e9s, ou ses partenaires, cons\\u00e9cutive \\u00e0 l\'envoi, l\'affichage, la diffusion, l\'\\u00e9mission, l\'\\u00e9dition, la mise en ligne ou la transmission de Contenu par vos soins sur les Services, ou du fait de votre utilisation des Services, vous vous engagez \\u00e0 assister DIKITIVI, ses repr\\u00e9sentants, salari\\u00e9s, ou partenaires dans la pr\\u00e9paration de leur r\\u00e9ponse ou d\\u00e9fense en leur communiquant tous documents, donn\\u00e9es ou informations utiles \\u00e0 cette fin.\\n\\n**7 - Acceptation**\\nEn utilisant notre site \\/application, vous consentez \\u00e0 accepter toutes les conditions g\\u00e9n\\u00e9rales d\'utilisation contenues dans ce pr\\u00e9sent document. \\nLes questions ou commentaires sur le Site peuvent \\u00eatre adress\\u00e9s par email \\u00e0 contact@dikitivi.com.\\n\\n**8 - Entr\\u00e9e en vigueur**\\nLes pr\\u00e9sentes CGU ont \\u00e9t\\u00e9 approuv\\u00e9es par la coordination de DIKITIVI et entre en vigueur le 12 Septembre 2024. \\n\",\"en\":null,\"ln\":null}', NULL, NULL, '2024-12-15 23:06:52', '2024-12-15 23:06:52', 14);
