(41, 'TBN Français en Direct', 'TBN Francophone, votre Télévision Chrétienne de la Bonne Nouvelle !\r\nRetrouvez votre télévision chrétienne favorite, avec la pensée du jour en live 7j/7\r\nTBN vous propose le meilleur de ses programmes internationaux en français !\r\nLa foi, la famille, l\'amitié, l\'actualité mondiale... Sur TBN FR, retrouvez les meilleurs débats et enseignements des plus grands orateurs internationaux, fondés sur l\'espoir en Christ !\r\nDécouvrez aussi nos programmes tournés à Jérusalem, et immergez-vous dans ces lieux emblématiques qui ont vu naître la Parole de Dieu, à la lumière de ses traditions !\r\nNous émissions changent des vies - que la vôtre soit aussi transformée par le message d\'amour de Dieu pour vous !', 'youtube', NULL, NULL, 'https://www.youtube.com/embed/RX2q1yvKekg?si=h4kAv0ZYwigODImJ', NULL, NULL, NULL, NULL, NULL, '2024-04-28', 'images/medias/41/cover/01JWRCQB4KPFS0B2CQR2DR2EQJ.jpeg', 'images/medias/41/thumbnail/01JWRCQB4XJRDEP9J5EEJTXQJ7.jpeg', NULL, 1, 1, NULL, '2024-04-28 21:12:45', '2025-06-02 13:38:49', 6, NULL, 0),
