(185, 'Le chemin du pardon', 'Après la tragique disparition de sa fille, Mack Philipps, père de trois enfants, est rongé par la tristesse et la culpabilité, niant l\'existence de Dieu. Un jour, il reçoit une mystérieuse invitation le conviant à un week-end sur les lieux du crime, une cabane abandonnée où sa fille a été retrouvée assassinée. Intrigué, il s’y rend et rencontre trois personnages. De reproches en échanges, il va découvrir qui sont vraiment Dieu, Jésus et le Saint-Esprit. Cette rencontre va non seulement lui permettre de guérir sa souffrance, mais également le réconcilier avec lui-même et avec Dieu.', 'youtube', NULL, '02:26:00', 'https://www.youtube.com/embed/oxJ5lPl6g_Y?si=xuAAUXuvj89k5Ofn&amp;controls=0', NULL, 'Gael Media', 'Gael Media', 'Gael Media', NULL, '2024-05-14', '/images/medias/185/thumbnail/mw6wPRrTOMJwOeBZoR4uvERUG5tfOvz99uCtQ7Rg.jpg', '/images/medias/185/thumbnail/mw6wPRrTOMJwOeBZoR4uvERUG5tfOvz99uCtQ7Rg.jpg', NULL, 1, 0, NULL, '2024-05-02 11:48:18', '2026-01-18 14:36:13', 3, NULL, 1),
